import React, { Fragment } from "react";
import { Link } from 'react-router-dom';
import { Col } from '../Grid';
import './Nav.css';



const Nav = (props) => {
  let greeting;

  if (props.user === null) {
		greeting = <p>Hello guest</p>
	} else if (props.user.firstName) {
		greeting = (
			<Fragment>
				Welcome back, <strong>{props.user.firstName}</strong>
			</Fragment>
		)
	} else if (props.user.username) {
		greeting = (
			<Fragment>
				Welcome back, <strong>{props.user.username} </strong>
			</Fragment>
		)
  }

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-success">
      <Col size="md-3 sm-3">
        <Link to="/" className="navbar-brand">HOME</Link>
      </Col >
      <Col size="md-3 sm-3">
        <div className="float-left">
            <Link to="/Category" className="navbar-category">Category</Link>
            <Link to="/Contact" className="navbar-contact">Contact</Link>
            <Link to="/Login" className="navbar-login">Store Login</Link>
        </div>
      </Col >
      <Col size="md-3 sm-3">
        <div className="float-right">
        {greeting} - <Link to="#" className="logout" onClick={props.logout}>Logout</Link>
        </div>
      </Col>
    </nav>
  )
};

export default Nav;
